INSERT INTO `contenido` (`contenido_id`, `modulo`, `titulo`, `contenido`) VALUES
(5, 'inicio', 'Este es el inicio de la aplicaron', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\n<h1>&nbsp;</h1>\n<h1><img src=\"data:image/gif;base64,\" width=\"269\" height=\"101\" /></h1>\n<p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" width=\"1015\" height=\"274\" /></p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<table style=\"border-collapse: collapse; width: 32.478%; height: 281px; border-color: #ffffff; border-style: none;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 3.08642%; text-align: justify;\"><span style=\"color: #626262; text-align: justify; font-size: 14pt; font-family: verdana, geneva, sans-serif;\">&nbsp;</span></td>\n<td style=\"width: 46.6142%; text-align: justify;\"><span style=\"color: #626262; text-align: justify; font-size: 14pt; font-family: verdana, geneva, sans-serif;\">Somos una droguer&iacute;a dedicada a brindar los mejores art&iacute;culos para el cuidado de la salud, belleza e higiene personal y as&iacute; mejorar la calidad de vida de nuestros clientes, estamos comprometidos con su salud. Encuentra lo que necesitas en un solo lugar, y con entrega a domicilio sin costo alguno.-PRUEBA</span></td>\n</tr>\n</tbody>\n</table>\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe src=\"//www.youtube.com/embed/boVmqMPXomQ\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</body>\r\n</html>');
INSERT INTO `contenido` (`contenido_id`, `modulo`, `titulo`, `contenido`) VALUES
(6, 'mision', 'Esta es la mision', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\">&nbsp;</h2>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\">MISI&Oacute;N&nbsp;</h2>\n<p style=\"text-align: justify;\">La DROGUER&Iacute;A NI&Ntilde;A YUDI de alto baudo somos una farmacia conformada por un equipo de personas motivadas a dar lo mejor de s&iacute;, orientada a brindar un servicio que satisfaga los clientes y usuarios, sustentados en sistema de gesti&oacute;n de calidad y en el mejoramiento continuo de sus procesos con criterios de responsabilidad y profesionalismo con todos nuestros usuarios.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" /></p>\n</body>\n</html>');
INSERT INTO `contenido` (`contenido_id`, `modulo`, `titulo`, `contenido`) VALUES
(12, 'vision', 'Esta es la vision', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\">VISI&Oacute;N</h2>\n<p class=\"MsoNormal\" style=\"text-align: justify;\">La DROGUER&Iacute;A NI&Ntilde;A YUDI. De alto Baud&oacute;, trabajamos en un equipo de forma productiva y eficiente, mejorando cada d&iacute;a para ser reconocidos por la comunidad como farmacia de mayor confianza, y mejor calidad de la regi&oacute;n extendi&eacute;ndonos en todos los puntos importantes del municipio de alto Baud&oacute;. En los pr&oacute;ximos 10 a&ntilde;os pretendemos ser de las m&aacute;s reconocidas droguer&iacute;as de alto Baud&oacute; en la prestaci&oacute;n de venta y suministro de medicamentos en nuestro municipio, y tambi&eacute;n de otros municipios aleda&ntilde;os al nuestro.</p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" /></p>\n</body>\n</html>');
INSERT INTO `contenido` (`contenido_id`, `modulo`, `titulo`, `contenido`) VALUES
(14, 'presentacion', 'Esta es la presentacion', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p style=\"color: #626262;\">&nbsp;</p>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\">NOSOTROS</h2>\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\n<p style=\"color: #626262; text-align: justify;\"><span style=\"text-align: justify; font-family: verdana, geneva, sans-serif;\">Somos una empresa alto Baudoce&ntilde;a que inici&oacute; sus labores en la comunidad de puerto Echeverry, Estamos presentes en el mercado y especialmente en el departamento del Choc&oacute; municipio de Quibd&oacute;, alto Baud&oacute; mediante los servicios farmac&eacute;uticos, con distribuci&oacute;n de medicamentos gen&eacute;ricos, PORTAFOLIO DE SERVICIOS: droguer&iacute;a ni&ntilde;a yudi NIT. 1075020392-1. La imagen de LA DROGUER&Iacute;A NI&Ntilde;A YUDI es reconocida en Quibd&oacute; y alto Baud&oacute; a pesar de su corta vida comercial y de servicios, manteniendo una posici&oacute;n de liderazgo y prestigio ante las instituciones administradores del r&eacute;gimen subsidiado, por la calidad de sus productos y el buen servicio prestado a sus usuarios. LA DROGUER&Iacute;A NI&Ntilde;A YUDI. Fue certificada por las Secretarias de Salud del Choc&oacute; para prestar servicios farmac&eacute;uticos con buenas pr&aacute;cticas de Manufactura, lo que le permitir&aacute; en el siglo XXI continuar ofreciendo medicamentos de excelente calidad, seguros y confiables al sistema de salud del alto Baud&oacute;.</span></p>\n</body>\n</html>'),
(16, 'servicio', 'Este es el servicio ', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\">&nbsp;</h2>\n<h2 class=\"MsoNormal\" style=\"text-align: center;\"><strong><span style=\"font-family: verdana, geneva, sans-serif; color: #e67e23;\">Productos farmac&eacute;uticos y personales a domicilio</span></strong></h2>\n<p style=\"text-align: center;\"><span style=\"font-family: verdana, geneva, sans-serif; color: #000000;\"><span style=\"font-family: verdana, geneva, sans-serif;\">Manejamos las mejores marcas en los siguientes productos</span></span></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<table style=\"border-collapse: collapse; width: 38.0915%; height: 281px; border-color: #ffffff; border-style: none;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 22.2222%; text-align: justify;\"><span style=\"color: #626262; text-align: justify; font-size: 14pt; font-family: verdana, geneva, sans-serif;\">&nbsp;</span></td>\n<td style=\"width: 44.0965%; text-align: justify;\">\n<ul>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Antipa&ntilde;alitis</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Jabones</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Fragancias</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Hidratantes</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Limpieza</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Pa&ntilde;ales</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Repelentes</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Bloqueadores Pa&ntilde;os H&uacute;medos</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Cuidado Capilar, Facial</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Tintes</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Cepillo Dental</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Crema Dental</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Fijaci&oacute;n Capilar</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Toallas</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Tampones</li>\n<li class=\"MsoNormal\" style=\"text-align: left;\">Protectores</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><img src=\"data:image/png;base64,\" width=\"1016\" height=\"240\" /></p>\n</body>\n</html>');
